import './App.css';
import App from './App';
import AppAlphabets from './AppAlphabets';
import SideBar from './SideBar';


function Container() {
  return (
    <div className="app">
      <SideBar/>
      <div class="container">
        <App/>
        <AppAlphabets/>
      </div>

    </div>
  );
}

export default Container;
